static PCI_IDS* get_device_ids(uint32_t vendor, uint32_t device, uint32_t subvendor, uint32_t subdevice) 
{ 
	PCI_IDS* pci_ids = pci_database; 
	for (int i = 0; i < sizeof(pci_database) / sizeof(pci_database[0]); i++, pci_ids++) 
	{ 
		if (pci_ids->vendor == vendor && 
			pci_ids->device == device && 
			pci_ids->subvendor == subvendor && 
			pci_ids->subdevice == subdevice) 
		{ 
			return pci_ids; 
		} 
	} 
	return NULL; 
} 

static PCI_DEVICE_CLASS* get_device_class(uint32_t baseclass, uint32_t subclass, uint32_t progif) 
{ 
   PCI_DEVICE_CLASS* device_class = pci_device_classes; 
   for (int i = 0; i < sizeof(device_class) / sizeof(device_class[0]); i++, device_class++) 
   { 
        if (device_class->baseclass == baseclass && 
            device_class->subclass == subclass && 
	         device_class->progif == progif) 
        { 
	        return device_class; 
        } 
    } 
    return NULL; 
} 
